import React, { useEffect, lazy, Suspense } from "react";
import { Route, Routes, BrowserRouter } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";

import WithSuspense from "./hooks/withSuspense.jsx";

import { fetchAuthMe, selectIsAuth } from "./redux/slices/auth.js";

import { Navbar, Footer } from "./components/routes/index.js";

import { Landing } from "./pages/index.js";

const Registration = lazy(() =>
  import("./pages/Authentication/Registration.jsx")
);
const Login = lazy(() => import("./pages/index.js"));
const NotFound = lazy(() => import("./pages/index.js"));
const Category = lazy(() => import("./pages/index.js"));
const Sneaker = lazy(() => import("./pages/index.js"));
const Account = lazy(() => import("./pages/index.js"));
const Orders = lazy(() => import("./pages/index.js"));
const Basket = lazy(() => import("./pages/index.js"));
const Favorites = lazy(() => import("./pages/index.js"));

const App = () => {
  const dispatch = useDispatch();
  const isAuth = useSelector(selectIsAuth);

  useEffect(() => {
    dispatch(fetchAuthMe());
  }, [dispatch]);

  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/" element={<Landing />} />
        <Route path="/user">
          {isAuth && (
            <Route
              path="account"
              element={<WithSuspense Childern={<Account />} />}
            />
          )}
          <Route path="basket" element={<Basket />} />
          <Route path="orders" element={<Orders />} />
        </Route>
        <Route path="/sneakers">
          <Route path="men" element={<Category />} />
          <Route path="women" element={<Category />} />
          <Route path="kids" element={<Category />} />
          <Route path=":id" element={<Sneaker />} />
          <Route path="favorites" element={<Favorites />} />
        </Route>
        <Route path="login" element={<Login />} />
        <Route
          path="registartion"
          element={<WithSuspense Childern={<Registration />} />}
        />
        <Route path="*" element={<NotFound />} />
      </Routes>
      <Footer />
    </BrowserRouter>
  );
};

export default App;
